from collections import defaultdict

def Minimizing_skew(text):
    pos = defaultdict(list)
    ans,mn = 0,0
    for i in range(len(text)):
        if text[i] == 'G':
            ans += 1
        elif text[i] == 'C':
            ans -= 1
        if(ans <= mn):
            mn = ans
            pos[mn].append(str(i+1))
#     print(pos)
    return ' '.join(pos[mn])

